import * as Common from '../common/common.js';  // eslint-disable-line no-unused-vars
import * as UI from '../ui/ui.js';

import { InspectedPagePlaceholder } from './InspectedPagePlaceholder.js';  // eslint-disable-line no-unused-vars


/** @type {!PrintModeWrapper} */
let printModeWrapperInstance;

export class PrintModeView extends UI.Widget.VBox {
  constructor() {
    super(true);
    const iframe = /** @type {HTMLIFrameElement} */(this.contentElement.createChild('iframe'));
    // @ts-ignore
    iframe.style = 'width:100%;height:100%';
    iframe.src = 'data:application/pdf;base64,';
  }
}

export class PrintModeWrapper extends UI.Widget.VBox {
  /**
   * @param {!InspectedPagePlaceholder} inspectedPagePlaceholder
   * @private
   */
  constructor(inspectedPagePlaceholder) {
    super();
    this._inspectedPagePlaceholder = inspectedPagePlaceholder;
    /** @type {?PrintModeView} */
    this._printModeView = null;
    this._showPrintModeSetting = Common.Settings.Settings.instance().createSetting('emulation.show-print-mode', true);
    this._togglePrintModeAction = UI.ActionRegistry.ActionRegistry.instance().action('emulation.toggle-print-mode');
    this._update(true);
  }

  /**
   * @param {{forceNew: ?boolean, inspectedPagePlaceholder: ?InspectedPagePlaceholder}} opts
   */
  static instance(opts = { forceNew: null, inspectedPagePlaceholder: null }) {
    const { forceNew, inspectedPagePlaceholder } = opts;
    if (!printModeWrapperInstance || forceNew) {
      if (!inspectedPagePlaceholder) {
        throw new Error(
          `Unable to create PrintModeWrapper: inspectedPagePlaceholder must be provided: ${new Error().stack}`);
      }

      printModeWrapperInstance = new PrintModeWrapper(inspectedPagePlaceholder);
    }

    return printModeWrapperInstance;
  }

  _togglePrintMode() {
    this._showPrintModeSetting.set(!this._showPrintModeSetting.get());
  }

  /**
   * @param {boolean} force
   */
  _update(force) {
    if (this._togglePrintModeAction) {
      this._togglePrintModeAction.setToggled(this._showPrintModeSetting.get());
    }
    if (!force) {
      const showing = this._printModeView && this._printModeView.isShowing();
      if (this._showPrintModeSetting.get() === showing) {
        return;
      }
    }

    if (this._showPrintModeSetting.get()) {
      if (!this._printModeView) {
        this._printModeView = new PrintModeView();
      }
      this._printModeView.show(this.element);
      this._inspectedPagePlaceholder.clearMinimumSize();
      this._inspectedPagePlaceholder.show(this._printModeView.element);
    } else {
      if (this._printModeView) {
        this._printModeView.detach();
      }
      this._inspectedPagePlaceholder.restoreMinimumSize();
      this._inspectedPagePlaceholder.show(this.element);
    }
  }
}

/** @type {!ActionDelegate} */
let actionDelegateInstance;

/**
 * @implements {UI.ActionRegistration.ActionDelegate}
 */
export class ActionDelegate {
  /**
   * @override
   * @param {!UI.Context.Context} context
   * @param {string} actionId
   * @return {boolean}
   */
  handleAction(context, actionId) {
    if (PrintModeWrapper.instance()) {
      switch (actionId) {
        case 'emulation.toggle-print-mode':
          PrintModeWrapper.instance()._togglePrintMode();
          return true;
      }
    }
    return false;
  }
  /**
   * @param {{forceNew: ?boolean}} opts
   */
  static instance(opts = { forceNew: null }) {
    const { forceNew } = opts;
    if (!actionDelegateInstance || forceNew) {
      actionDelegateInstance = new ActionDelegate();
    }

    return actionDelegateInstance;
  }
}
